import api from "./baseApi";

export const mailApi = {
  get(params, cancelToken) {
    return api.get("/api/mail-schedule", { params, cancelToken });
  },
  getById(id) {
    return api.post(`/api/mail-schedule/${id}`);
  },
  post(payload) {
    return api.post(`/api/mail-schedule`, payload);
  },
  put(id, payload) {
    return api.put(`/api/mail-schedule/${id}`, payload);
  },
  delete(id) {
    return api.delete(`/api/mail-schedule/${id}`);
  },
};
